'use strict';

var randu = require( '@stdlib/random/base/randu' );
var gammaDeltaRatio = require( './../lib' );

var delta;
var z;
var i;

for ( i = 0; i < 100; i++ ) {
	z = randu()*10.0;
	delta = randu()*10.0;
	console.log( 'gamma( %d ) / gamma( %d + %d ) = %d', z, z, delta, gammaDeltaRatio( z, delta ) );
}
